import React from "react";
import { Box, Link, CssBaseline, AppBar, Toolbar } from "@mui/material";

import "./shop.styles.scss";

export const SubNavBar = () => {
  return (
    <Box sx={{ display: { sm: "flex" } }}>
      <CssBaseline />
      <AppBar
        position="fixed"
        sx={{
          borderBottomLeftRadius: 50,
        }}
        // position="static"
        color="default"
        className="navbar"
      >
        <Toolbar>
          <Link className="link" href="/" color="inherit" underline="hover">
            Home
          </Link>
          <Link className="link" href="/Shop" color="inherit" underline="hover">
            Shop
          </Link>
          <Link className="link" href="/" color="inherit" underline="hover">
            About
          </Link>
          <Link className="link" href="/" color="inherit" underline="hover">
            Contact
          </Link>
        </Toolbar>
      </AppBar>
    </Box>
  );
};
const Shop = () => {
  return (
    <div className="shopContainer">
      <SubNavBar />
      Shopping
    </div>
  );
};

export default Shop;
